import React from 'react';

import {NavLink} from 'react-router-dom';
const Menu = () => {
    return(
<>
<NavLink exact to="/about"> About </NavLink>
<NavLink exact to="/search"> Search </NavLink>
</>
    );
}
export default Menu;
